import React from "react";
import "./ContentBox.css";

import OverviewContentBox from "./OverviewContent";

class ContentBox extends React.Component {
  render() {
    let Navitem;
    console.log("got index as " + this.props.NavValue);
    switch (this.props.NavValue) {
      case 0:
        Navitem = <OverviewContentBox />;
        break;
      case 2:
        Navitem = (
          <div class="responsive-iframe-container big-container">
            <iframe
              src="https://calendar.google.com/calendar/embed?title=Put%20your%20Title%20here&amp;showCalendars=0&amp;height=600&amp;wkst=1&amp;bgcolor=%23ffffff&amp;src=8d3fc8l9g04n7r9im45fsn08ak%40group.calendar.google.com&amp;color=%238D6F47&amp;ctz=America%2FNew_York"
              style={{ borderWidth: 0 }}
              title="Calender"
              width="800"
              height="600"
              frameborder="0"
              scrolling="no"
            ></iframe>
          </div>
        );
        break;
      default:
        Navitem = <p>Page under Construction</p>;
    }
    return <div className="ContentBox">{Navitem}</div>;
  }
}

export default ContentBox;
